import { Breadcrumb, Tag, Space, Divider } from "antd";
const MenuNavibarLayout = ({ menus }) => {
  return (
    <>
      <Breadcrumb style={{ backgroundColor: `white` }} separator={""}>
        <Space size={`middle`}>
          {menus.map((menu) => (
            <Breadcrumb.Item>{menu}</Breadcrumb.Item>
          ))}
        </Space>
      </Breadcrumb>
      <Divider />
    </>
  );
};

export default MenuNavibarLayout;
